import React from 'react';
import Dropdown from './Dropdown.js';
import './Form.css';

const options = [
    {
        label: 'Select an option',
        value: null
    },
    {
        label: 'Red',
        value: 'red',
    },
    {
        label: 'Blue',
        value: 'blue',
    }
];

const title="All ERP";

const Form = () => {
    return (
        <form>
            <div className='all-erp-dd'>
                <Dropdown options={options} title={title}/>
            </div>
        </form>
    );
}

export default Form;
